import React from 'react';
import '../styles/logo.css'; // стили для анимации

function Logo() {
  return (
     <svg
      className="gallery-icon"
      width="50"
      height="50"
      viewBox="0 0 64 64"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      role="img"
      aria-label="Gallery Icon"
    >
      <rect x="8" y="16" width="48" height="32" rx="4" ry="4" stroke="#007bff" strokeWidth="4" fill="#e0f0ff" />
      <circle cx="32" cy="32" r="10" stroke="#007bff" strokeWidth="4" fill="#c0d8ff" />
      <rect x="24" y="10" width="16" height="8" rx="2" ry="2" fill="#007bff" />
    </svg>
  );
}

export default Logo;
